public class DialogTweets extends JDialog implements ActionListener {

    /** Remove button. */
    private JButton remove;

    /** Jlist of tweets. */
    private JList<String> list;

    /** list of tweets to be removed. */
    private ArrayList<Long> removeList = new ArrayList<Long>();

    /** Tweet. */
    private Tweets tweets;

    /** Width of JDialog. */
    private final int w = 700;
    /** Length of JDialog. */
    private final int l = 700;

    /****************************************************
     * DialogTweets Class.
     * 
     * @param parent
     *            JFrame
     * @param t
     *            Tweets
     ***************************************************/
    public DialogTweets(final JFrame parent, final Tweets t) {
        super(parent, true);

        setLayout(new BorderLayout());

        tweets = t;

        setTitle("Tweets");

        setSize(w, l);
        setLocationRelativeTo(parent);

        list = new JList<String>(tweets);

        JScrollPane scrollpane = new JScrollPane(list);
        add(scrollpane, BorderLayout.CENTER);

        remove = new JButton("Remove");
        remove.addActionListener(this);

        add(remove, BorderLayout.SOUTH);

        pack();
        setVisible(true);

    }

    @Override
    public final void actionPerformed(final ActionEvent e) {
        if (e.getSource() == remove) {
            int i = list.getSelectedIndex();
            if (i >= 0) {
                removeList.add(tweets.remove(i));
            } else {
                JOptionPane.showMessageDialog(null,
                        "Please first select a tweet", "Oops!",
                        JOptionPane.PLAIN_MESSAGE);
            }
        }

    }

    /****************************************************
     * Removes list.
     * 
     * @return ArrayList<Lsong>
     ***************************************************/
    public final ArrayList<Long> getRemoveList() {
        return removeList;
    }

}

package model;

import java.util.ArrayList;

import javax.swing.AbstractListModel;

import twitter4j.User;

/****************************************************
 * Users Class.
 ***************************************************/
public class Users extends AbstractListModel<String> {

    /** serialVersionUID. */
    private static final long serialVersionUID = 1L;

    /** Arraylist of users. */
    private ArrayList<User> users;

    /****************************************************
     * Users Constructor.
     *
     * @param f
     *            ArrayList<User>
     ***************************************************/
    public Users(final ArrayList<User> f) {
        super();
        users = f;
    }

    @Override
    public final String getElementAt(final int i) {
        User u = users.get(i);

        String str = "Name: ";
        str += u.getName();
        str += ", Screen Name: ";
        str += u.getScreenName();

        return str;
    }

    @Override
    /****************************************************
     * Gets user size.
     ***************************************************/
    public final int getSize() {
        return users.size();
    }

    /****************************************************
     * Adds User.
     *
     * @param u
     *            User
     ***************************************************/
    public final void add(final User u) {
        users.add(u);
    }

    /****************************************************
     * Removes user.
     *
     * @param index
     *            int
     * @return long
     ***************************************************/
    public final long remove(final int index) {
        long l = users.get(index).getId();
        users.remove(index);
        fireIntervalRemoved(this, 0, users.size());
        return l;
    }
}

package model;

import java.text.SimpleDateFormat;
import java.util.ArrayList;

import javax.swing.AbstractListModel;

import twitter4j.Status;

/****************************************************
 * Tweets Class.
 ***************************************************/
public class Tweets extends AbstractListModel<String> {

    /** serialVersionUID. */
    private static final long serialVersionUID = 1L;

    /** ArrayList tweets. */
    private ArrayList<Status> tweets;

    /****************************************************
     * Tweets Constructor.
     ***************************************************/
    public Tweets() {
        super();
        tweets = new ArrayList<Status>();
    }

    @Override
    public final String getElementAt(final int i) {
        Status s = tweets.get(i);

        SimpleDateFormat df = new SimpleDateFormat();
        df.applyPattern("MM/dd/yyyy");

        String str = "Time: ";
        str += df.format(s.getCreatedAt());
        str += ", Status: ";
        str += s.getText();

        return str;
    }

    @Override
    /****************************************************
     * Gets size of tweet.
     ***************************************************/
    public final int getSize() {
        return tweets.size();
    }

    /****************************************************
     * Adds tweet.
     *
     * @param s
     *            Status
     ***************************************************/
    public final void add(final Status s) {
        tweets.add(s);
    }

    /****************************************************
     * Removes Tweet.
     *
     * @param index
     *            int
     * @return l long
     ***************************************************/
    public final long remove(final int index) {
        long l = tweets.get(index).getId();
        tweets.remove(index);
        fireIntervalRemoved(this, 0, tweets.size());
        return l;
    }
}

